using System;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace TestCSharpPart
{
    [TestClass]
    public class ImageExperiments
    {
        [TestMethod]
        public void TestForTest()
        {
            Assert.AreEqual(1, 1);
        }

        [TestMethod]
        public void TestBase64()
        {
            var catAsBytesArray = System.IO.File.ReadAllBytes(@"C:\pusheencat.png");
            Assert.IsNotNull(catAsBytesArray);

            //bytes arr -> base64 string 
            var catAsBase64 = Convert.ToBase64String(catAsBytesArray);
            Assert.AreEqual(catAsBase64, "");
                                    //    ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^...
                                    //    data part of the Data Uri scheme              

            //base64 string -> bytes array
            var newBytesArr = Convert.FromBase64String(catAsBase64);
            Assert.AreEqual(newBytesArr.Length, catAsBytesArray.Length);
            for(var i = 0; i != catAsBytesArray.Length; ++i)
                Assert.AreEqual(newBytesArr[i], catAsBytesArray[i]);
        }
    }
}
